const SignUp = () => {
  return (
    <form onSubmit={''} className='signup-form'>
      <input
        type='text'
        placeholder='氏名'
        value={''}
        onChange={(e) => {}}
        className='input-field'
      />
      <input
        type='date'
        placeholder='生年月日'
        value={'dob'}
        onChange={(e) => {}}
        className='input-field'
      />
      <input
        type='email'
        placeholder='メールアドレス'
        value={''}
        onChange={(e) => {}}
        className='input-field'
      />
      <input
        type='password'
        placeholder='パスワード'
        value={''}
        onChange={(e) => {}}
        className='input-field'
      />
      <div className='checkbox-container'>
        <label>
          <input
            type='checkbox'
            checked={false}
            onChange={(e) => {}}
            className='input-checkbox'
          />
          規約同意
        </label>
      </div>
      <button type='submit' className='submit-button'>
        登録
      </button>
    </form>
  );
};

export default SignUp;
